import './App.css';
import {useState} from "react";
import ModalImage from "react-modal-image";
import axios, {Axios} from "axios";

const SearchResult = () => {
    const [isOpen, setIsOpen] = useState(false);

    return(
        <div>
            <div className="search-result-container">
                <div className="search-result-info-area">
                    <h2>Title</h2>
                    <p>Description</p>
                </div>
                <ModalImage
                    small={"https://www.artic.edu/iiif/2/1adf2696-8489-499b-cad2-821d7fde4b33/full/400,/0/default.jpg"}
                    large={"https://www.artic.edu/iiif/2/1adf2696-8489-499b-cad2-821d7fde4b33/full/843,/0/default.jpg"}
                    alt="Title"
                />
            </div>
        </div>
    )
}

function App() {
  const [inputText, setInputText] = useState('cats');
  const [activeImageID, setActiveImageID] = useState('1adf2696-8489-499b-cad2-821d7fde4b33');

  function sendRequest(inputText) {
      axios({
          method: 'get',
          url: "https://api.artic.edu/api/v1/artworks/search?q=" + inputText,
          responseType: 'json'
      }).then(
          response => {
              console.log(response);
          }
      )
  }

  function getImage(imageID) {
    return "https://www.artic.edu/iiif/2/" + imageID + "/full/843,/0/default.jpg"
  }


  return (
    <div className="App">
      <header className="App-header">
          <h1>Art Institute of Chicago Search</h1>
      </header>
        <div className="Body">
            <SearchField
                placeholder="Search art by name, type, keyword, etc..."
                onEnter={(val, event) => {
                    sendRequest(val);
                }}
                onSearchClick={(val) => {
                    sendRequest(val)
                }}
                searchText="This is initial search text"
                classNames="test-class"
            />
            <SearchResult />
        </div>
    </div>
  );
}

export default App;
